import Link from "next/link"

const NotFound = () => {
    return (
        <div className="not-found">
            <h2>Sorry, Please Back to Top</h2>
            <p>Go Back To <Link href="/"><a>Home</a></Link></p>
        </div>
    )
}

export default NotFound
